import React, { useState } from 'react';
import '../styles/style.scss';
import Logo from '../assets/logo.svg';
import Footer from './Footer';

function Home() {
  const [searchTerm, setSearchTerm] = useState('');

  const experiments = [
    { id: 1, name: 'Experiment 1: Chemical Reaction', description: 'Study of chemical reactions and properties.' },
    { id: 2, name: 'Experiment 2: Physics Simulation', description: 'Simulation of various physics phenomena and detailed analysis of physical systems over a long duration.' },
    { id: 3, name: 'Experiment 3: Biology Study', description: 'Observation and study of biological organisms.' },
    { id: 4, name: 'Experiment 4: Quantum Mechanics', description: 'Exploration of quantum mechanical systems, including their probabilistic behavior and experimental verifications.' },
    { id: 5, name: 'Experiment 5: AI Model Training', description: 'Training of machine learning models using different datasets and optimization techniques.' },
    { id: 6, name: 'Experiment 6: Robotics Programming', description: 'Programming and controlling robots using modern techniques and algorithms for motion planning and manipulation.' }
  ];

  const filteredList = experiments.filter((experiment) =>
    experiment.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const handleInputChange = (e) => {
    setSearchTerm(e.target.value);
  };

  return (
    <div className='container'>
      <header className='navbar'>
        <img src={Logo} alt="" />
      </header>
      <main className='main_content'>
        <div className='searching_area'>
          <p className='searching_title'>Experiments</p>
          <div className='searching_result'>
            {/* 搜尋欄位 */}
            <input
              type="text"
              placeholder="Type keywords to filter database names"
              value={searchTerm}
              onChange={handleInputChange}
              className='input_style'
            />

            {/* 使用 Table 來顯示過濾後的列表 */}
            <table className='searching_table'>
              <thead>
                <tr>
                  <th className="id-col">ID</th>
                  <th className="name-col">Experiment Name</th>
                  <th className="desc-col">Description</th>
                </tr>
              </thead>
              <tbody>
                {filteredList.length > 0 ? (
                  filteredList.map((experiment) => (
                    <tr key={experiment.id}>
                      <td className="id-col">{experiment.id}</td>
                      <td className="name-col">{experiment.name}</td>
                      <td className="desc-col">{experiment.description}</td>
                    </tr>
                  ))
                ) : (
                  <tr>
                    <td colSpan="3">No matching items found</td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
        </div>
      </main>
      <Footer />
    </div>
  );
}

export default Home;
